import React from 'react'
import styled from 'styled-components'
import Events1 from './Events/Events1'

const Container = styled.section`
    margin-top: 5em;
    padding-top: 1em;
    padding-left: 5em;
    z-index: 2;
`

function Events() {
  return (
    <Container>
        <Events1/>

        <div>
            <div>
                <h3>Community events</h3>
                <button>Submit your Event</button>
            </div>

            <div>View Past Events</div>
        </div>
    </Container>
  )
}

export default Events
